import React from "react";
import BookList from "../containers/BookList";
import AuthorCreator from "../containers/AuthorCreator";
import BookCreator from "../containers/BookCreator";
import * as S from './Main.styles.js';

function Main() {
  return (
    <>
      <BookList />
      <AuthorCreator />
      <BookCreator />
    </>
  );
}

export default Main;
